import React, { Component } from "react";
import AccountCircle from "@material-ui/icons/AccountCircle";
import LockIcon from "@material-ui/icons/Lock";
import Header from "Components/Header";
import InputAdornment from "@material-ui/core/InputAdornment";
import {
  Typography,
  withStyles,
  TextField,
  Button,
  CssBaseline,
  Container,
  Link
} from "@material-ui/core";

import style from "./style";

class Layout extends Component {
  render() {
    const { classes } = this.props;
    return (
      // <div className={classes.container}>
      //   <Typography variant='h5'>Login Screen</Typography>
      // </div>
      <div>
        <Header title="Login" />
        <Container component="main" maxWidth="sm" className={classes.container}>
          <CssBaseline />
          <div className={classes.container}>
            {/* <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar> */}
            <img
              src="Images/avatar.svg"
              className={classes.svg1}
              width="150"
              height="150"
            />
            {/* <Typography
              component="h1"
              variant="h5"
              className={classes.Typography}
            >
              Sign In
            </Typography> */}
            <form className={classes.from} noValidate>
              <TextField
                className={classes.textField}
                margin="normal"
                fullWidth
                variant="outlined"
                placeholder="Enter Your email"
                autoComplete="email"
                InputProps={{
                  startAdornment: (
                    <InputAdornment className={classes.svg} position="start">
                      <AccountCircle />
                    </InputAdornment>
                  )
                }}
              />

              <TextField
                className={classes.textField}
                margin="normal"
                fullWidth
                type="password"
                variant="outlined"
                placeholder="Enter Your Password"
                InputProps={{
                  startAdornment: (
                    <InputAdornment className={classes.svg} position="start">
                      <LockIcon />
                    </InputAdornment>
                  )
                }}
              />

              <Button
                type="submit"
                fullWidth
                variant="contained"
                className={classes.btnsubmit}
              >
                Sign In
              </Button>
              {/* <Link href="Signup" variant="body2" className={classes.forget}>
                {"New to Stayin?  Sign Up"}
              </Link> */}
            </form>
          </div>
        </Container>
      </div>
    );
  }
}

export default withStyles(style)(Layout);
